import {AppBar, Toolbar, Box,Typography, styled} from '@mui/material';
//components 
import Search from './Search';
const StyledHeader=styled(AppBar)`
background: #2874f0;
height: 56px;
`;
const Component = styled(Box)`
margin-left:12%;
line-height:0;
`;
const SubHeading = styled(Typography)`
 font-size:10px;
 font-style:italic;
`;
const PlusImage = styled('img')({
    width:10,
    height:10,
    marginLeft:2
})
const Header =() => {
    const logoURL="https://static-assets-web.flixcart.com/fk-p-linchpin-web/fk-cp-zion/img/flipkart-plus_8d85f4.png";
    const subURL= "https://static-assets-web.flixcart.com/fk-p-linchpin-web/fk-cp-zion/img/plus_aef861.png"
    return (
        <StyledHeader>
            <Toolbar>
                <Component>
                    <img src ={logoURL} alt="logo" style={{width:80}}/>
                    <Box style ={{display:'flex'}}>
                    <SubHeading> Explore 
                        <Box component = "span" style = {{color:'#FFE500'}}> Plus </Box> </SubHeading>
                        <PlusImage src = {subURL} alt =" sub-logo"/>
                        </Box>
                </Component>
                <Search/>

            </Toolbar>
        </StyledHeader>
    )
}
export default Header;
